import React from 'react'

const ErrorNotificationBox = ({ errorData }) => {
    console.log(errorData)
    if (errorData) {
        return (
            <div>
                <span>{errorData.data}</span>
            </div>
        )
    }else {
        return null
    }

}

export default ErrorNotificationBox
